import React from 'react'
import { Heart, ShoppingCart, User } from 'lucide-react'

const Navbar = () => {
  return (
    <header className="bg-[#FFFFFF] h-20 px-4 flex items-center justify-between flex-wrap">
      {/* Left side: Logo */}
      <div className="flex items-center ml-4 sm:ml-8 hidden md:flex"> {/* Hidden on mobile (below 488px) */}
        <img src="logo png 1.png" alt="Logo" className="h-10" />
      </div>

      {/* Center: Menu items */}
      <nav className="flex justify-center space-x-8 w-full sm:w-auto mt-4 sm:mt-0">
        <a href="#" className="text-black text-base font-medium">Home</a>
        <a href="#" className="text-black text-base font-medium">Store</a>
        <a href="#" className="text-black text-base font-medium">Grooming</a>
        <a href="#" className="text-black text-base font-medium">Contact</a>
      </nav>

      {/* Right side: Icons */}
      <div className="flex items-center space-x-6 mr-4 sm:mr-10 mt-4 sm:mt-0 hidden md:flex"> {/* Hidden on mobile (below 488px) */}
        <Heart size={24} className="text-black" />
        <ShoppingCart size={24} className="text-black" />
        <User size={24} className="text-black" />
      </div>
    </header>
  )
}

export default Navbar
